import React from "react";
import { Col, Row, Card } from "reactstrap";

class Cards extends React.Component{
    render()
    {
        return(
            <Col lg="12" md="12" sm="12" xs="12">
                <div className="card-box">
                    <Row>
                        <div className="cover"></div>
                        <Col lg="3" md="3" sm="3" xs="3" style={{marginLeft:"6px",paddingTop:"4px"}}>
                            <div style={{borderRadius:"200%",textAlign:"center",border:"1px solid",height:"40px",width:"70%",display:"inline-block"}}>
                                <i class="fa fa-file" aria-hidden="true" style={{fontSize:"25px",height:"100%",display:"block",marginTop:"5px"}}></i>
                            </div>
                            
                        </Col>
                        <Col>
                            <strong>filename</strong>
                        </Col>
                    </Row>
                </div>
            </Col>
        );
    }
}

export default Cards;
